import React from 'react';
import menuImage from './images/logo1.png';
import happyHourImage from './images/img2.png';
import locationImage from './images/img1.png';
import dessertImage from './images/img3.png';
import drinksImage from './images/img1.png';
import snacksImage from './images/img2.png';
import seafoodImage from './images/img1.png';
import bakeryImage from './images/img2.png';

const styles = {
  homePage: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    backgroundColor: '#f9f7f4',
  },
  heroSection: {
    height: '30vh',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    position: 'relative',
    width: '100%',
  },
  heroOverlay: {
    color: '#8B4513', // Deep brown
    fontSize: '3rem',
    textAlign: 'center',
    fontFamily: "'Dancing Script', cursive",
  },
  circlesSection: {
    display: 'flex',
    justifyContent: 'center',
    gap: '20px',
    marginTop: '0.5cm', // Reduced margin to move circles closer to h1
  },
  circleItem: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  circleImage: {
    width: '75px',
    height: '75px',
    borderRadius: '50%',
    objectFit: 'cover',
    padding: '3px',
    background: 'linear-gradient(45deg, #8D6E63, #D4AF37, #d9b8a6)',
  },
  circleLabel: {
    marginTop: '8px',
    fontSize: '0.9rem',
    color: '#333',
    textAlign: 'center',
  },
  gridSection: {
    display: 'grid',
    gridTemplateColumns: 'repeat(3, 1fr)',
    gap: '0.5cm',
    padding: '20px',
  },
  gridItem: {
    textAlign: 'center',
    width: '150px',
    height: '150px',
  },
  gridImage: {
    width: '100%',
    height: '100%',
    borderRadius: '10px',
    objectFit: 'cover',
  },
  gridLabel: {
    marginTop: '10px',
    fontSize: '1rem',
    fontWeight: 'bold',
    color: '#333',
    textAlign: 'center',
  },
};

function HomePage() {
  return (
    <div style={styles.homePage}>
      {/* Hero Section */}
      <div style={styles.heroSection}>
        <div style={styles.heroOverlay}>
          <h1>CulinarEAT</h1>
        </div>
      </div>

      {/* Circles Section */}
      <div style={styles.circlesSection}>
        {[
          { img: menuImage, label: 'About Us' },
          { img: happyHourImage, label: 'Cooking Tips' },
          { img: locationImage, label: 'Baking Tips' },
          { img: dessertImage, label: 'Conversions' },
          { img: drinksImage, label: 'Special Offers' }, // Restored 5th circle
        ].map((circle, index) => (
          <div style={styles.circleItem} key={index}>
            <img src={circle.img} alt={circle.label} style={styles.circleImage} />
            <span style={styles.circleLabel}>{circle.label}</span>
          </div>
        ))}
      </div>

      {/* Grid Section */}
      <div style={styles.gridSection}>
        {[
          { img: menuImage, label: 'Menu' },
          { img: happyHourImage, label: 'Happy Hour' },
          { img: locationImage, label: 'Location' },
          { img: dessertImage, label: 'Desserts' },
          { img: drinksImage, label: 'Drinks' },
          { img: snacksImage, label: 'Snacks' },
          { img: seafoodImage, label: 'Seafood' },
          { img: bakeryImage, label: 'Bakery' },
        ].map((grid, index) => (
          <div style={styles.gridItem} key={index}>
            <img src={grid.img} alt={grid.label} style={styles.gridImage} />
            <h2 style={styles.gridLabel}>{grid.label}</h2>
          </div>
        ))}
      </div>
    </div>
  );
}

export default HomePage;
